    "2016-07-27T22:45:49.233654",nt"name": "desoto-national-wildlife-refuge-narrative-report-for-september-october-november-december-1-783b4",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for DeSoto National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1961. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, vegetation control,
    prescribed fires, and wildfires. A progress report on field investigations and applied
    research is also provided. Resource management is outlined; topics include timber
    removal. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, hunting, violations, and safety. Items of
    interest, N-R forms, and photographs are attached.",nt"license_title": "License
